import './App.css';
import logo from './images/logo.svg'

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <img src={logo} alt="logo"></img>
          <p> <strong>Will</strong>Verso </p>
      </header>
    </div>
  );
}

export default App;
